    false,nt"url": null,nt"notes": "This dataset is a result of the California
    Ocean Uses Atlas Project: a collaboration between NOAA's National Marine Protected
    Areas Center and Marine Conservation Biology Institute. The Project was designed
    to enhance ocean management through geospatial data on the full range of significant
    human uses of California's ocean environment from the shoreline to the 200 nm EEZ
    boundary. Data was gathered from regional ocean experts and users through participatory
    GIS methods. For more information on the project scope, background and related data
    products, please visit www.mpa.gov.",nt"license_title": null,nt"extras":
